INSERT INTO `book` (`id`, `author_id`, `title`, `description`, `genre_id`, `cover_image`, `publication_date`, `page_count`) VALUES
('9780307275264', 4, 'Kafka On the Shore', 'Kafka on the Shore displays one of the world\'s great storytellers at the peak of his powers.\r\n\r\nHere we meet a teenage boy, Kafka Tamura, who is on the run, and Nakata, an aging simpleton who is drawn to Kafka for reasons that he cannot fathom. As their paths converge, acclaimed author Haruki Murakami enfolds readers in a world where cats talk, fish fall from the sky, and spirits slip out of their bodies to make love or commit murder, in what is a truly remarkable journey.', 1, , '2005-07-22 09:25:32', 496);
INSERT INTO `book` (`id`, `author_id`, `title`, `description`, `genre_id`, `cover_image`, `publication_date`, `page_count`) VALUES
('9780307744661', 4, 'Norwegian Wood', 'This stunning and elegiac novel by the author of the internationally acclaimed Wind-Up Bird Chronicle has sold over 4 million copies in Japan and is now available to American audiences for the first time. It is sure to be a literary event.\r\n\r\nToru, a quiet and preternaturally serious young college student in Tokyo, is devoted to Naoko, a beautiful and introspective young woman, but their mutual passion is marked by the tragic death of their best friend years before. Toru begins to adapt to campus life and the loneliness and isolation he faces there, but Naoko finds the pressures and responsibilities of life unbearable. As she retreats further into her own world, Toru finds himself reaching out to others and drawn to a fiercely independent and sexually liberated young woman.\r\n\r\nA poignant story of one college student\'s romantic coming-of-age, Norwegian Wood takes us to that distant place of a young man\'s first, hopeless, and heroic love.', 1, , '2023-07-23 09:25:32', 400);
INSERT INTO `book` (`id`, `author_id`, `title`, `description`, `genre_id`, `cover_image`, `publication_date`, `page_count`) VALUES
('9780316398398', 1, 'Re:ZERO -Starting Life in Another World-, Vol. 1 (light novel)\r\n', 'Subaru Natsuki was just trying to get to the convenience store but wound up summoned to another world. He encounters the usual things--life-threatening situations, silver haired beauties, cat fairies--you know, normal stuff. All that would be bad enough, but he\'s also gained the most inconvenient magical ability of all--time travel, but he\'s got to die to use it. How do you repay someone who saved your life when all you can do is die?\n\n', NULL, , '2017-11-17 00:00:00', 248);
INSERT INTO `book` (`id`, `author_id`, `title`, `description`, `genre_id`, `cover_image`, `publication_date`, `page_count`) VALUES
('9780316479073', 1, 'Re:ZERO -Starting Life in Another World- Ex, Vol. 1 (light novel): The Dream of the Lion King\r\n', 'The bestselling series from author Tappei Nagatsuki continues in this spin-off where some of your favorite characters capture the spotlight!\r\n\r\n', NULL, , '2017-07-21 04:15:51', 224);
INSERT INTO `book` (`id`, `author_id`, `title`, `description`, `genre_id`, `cover_image`, `publication_date`, `page_count`) VALUES
('9780316769174', 3, 'Catcher in the Rye', 'The \"brilliant, funny, meaningful novel\" (The New Yorker) that established J. D. Salinger as a leading voice in American literature--and that has instilled in millions of readers around the world a lifelong love of books.\r\n\r\n\"If you really want to hear about it, the first thing you\'ll probably want to know is where I was born, and what my lousy childhood was like, and how my parents were occupied and all before they had me, and all that David Copperfield kind of crap, but I don\'t feel like going into it, if you want to know the truth.\"\r\n\r\nThe hero-narrator of The Catcher in the Rye is an ancient child of sixteen, a native New Yorker named Holden Caufield. Through circumstances that tend to preclude adult, secondhand description, he leaves his prep school in Pennsylvania and goes underground in New York City for three days.', 1, , '2001-01-30 12:19:54', 288);
INSERT INTO `book` (`id`, `author_id`, `title`, `description`, `genre_id`, `cover_image`, `publication_date`, `page_count`) VALUES
('9780393341768', 5, 'A Clockwork Orange', 'In Anthony Burgess’s influential nightmare vision of the future, where the criminals take over after dark, the story is told by the central character, Alex, a teen who talks in a fantastically inventive slang that evocatively renders his and his friends’ intense reaction against their society. Dazzling and transgressive, A Clockwork Orange is a frightening fable about good and evil and the meaning of human freedom.', 1, , '1962-01-01 09:39:00', 240);
INSERT INTO `book` (`id`, `author_id`, `title`, `description`, `genre_id`, `cover_image`, `publication_date`, `page_count`) VALUES
('9780525520047', 4, 'Killing Commendatore', 'The epic new novel from the internationally acclaimed and best-selling author of 1Q84\r\n\r\nIn Killing Commendatore, a thirty-something portrait painter in Tokyo is abandoned by his wife and finds himself holed up in the mountain home of a famous artist, Tomohiko Amada. When he discovers a previously unseen painting in the attic, he unintentionally opens a circle of mysterious circumstances. To close it, he must complete a journey that involves a mysterious ringing bell, a two-foot-high physical manifestation of an Idea, a dapper businessman who lives across the valley, a precocious thirteen-year-old girl, a Nazi assassination attempt during World War II in Vienna, a pit in the woods behind the artist’s home, and an underworld haunted by Double Metaphors. A tour de force of love and loneliness, war and art—as well as a loving homage to The Great Gatsby—Killing Commendatore is a stunning work of imagination from one of our greatest writers.', 1, , '2018-10-09 09:29:13', 704);
INSERT INTO `book` (`id`, `author_id`, `title`, `description`, `genre_id`, `cover_image`, `publication_date`, `page_count`) VALUES
('9780525555377', 6, 'Turtles All the Way Down', 'The critically acclaimed, instant #1 bestseller by John Green, author of The Anthropocene Reviewed and The Fault in Our Stars\r\n\r\nJohn Green, the award-winning, international bestselling author of The Anthropocene Reviewed, returns with a story of shattering, unflinching clarity in this brilliant novel of love, resilience, and the power of lifelong friendship.\r\n\r\nAza Holmes never intended to pursuethe disappearance of fugitive billionaire Russell Pickett, but there\'s a hundred-thousand-dollar reward at stake and her Best and Most Fearless Friend, Daisy, is eager to investigate. So together, they navigate the short distance and broad divides that separate them from Pickett\'s son Davis.\r\n\r\nAza is trying. She is trying to be a good daughter, a good friend, a good student, and maybe even a good detective, while also living within the ever-tightening spiral of her own thoughts.', 3, , '2017-10-10 09:39:00', 320);
INSERT INTO `book` (`id`, `author_id`, `title`, `description`, `genre_id`, `cover_image`, `publication_date`, `page_count`) VALUES
('9780679767398', 4, 'South of the Border, West of the Sun', '“A wise and beautiful book.” –The New York Times Book Review\r\n\r\nSouth of the Border, West of the Sun is the beguiling story of a past rekindled, and one of Haruki Murakami’s most touching novels.\r\n\r\nHajime has arrived at middle age with a loving family and an enviable career, yet he feels incomplete. When a childhood friend, now a beautiful woman, shows up with a secret from which she is unable to escape, the fault lines of doubt in Hajime’s quotidian existence begin to give way. Rich, mysterious, and quietly dazzling, in South of the Border, West of the Sun the simple arc of one man’s life becomes the exquisite literary terrain of Murakami’s remarkable genius.', 1, , '2000-03-14 09:29:13', 224);

